puzzle = puzzle.split("\n")
count = 0
xMasCount = 0
for linePos, line in enumerate(puzzle):
    for charPos, char in enumerate(line):
        if (char == "X"):
            # check up
            if linePos >= 3:
                if "".join([puzzle[linePos - 1][charPos], puzzle[linePos - 2][charPos], puzzle[linePos - 3][charPos]]) == "MAS":
                    count += 1
            # check down
            if linePos <= len(puzzle) - 1 - 3:
                if "".join([puzzle[linePos + 1][charPos], puzzle[linePos + 2][charPos], puzzle[linePos + 3][charPos]]) == "MAS":
                    count += 1
            # check left
            if charPos >= 3:
                if "".join([puzzle[linePos][charPos - 1], puzzle[linePos][charPos - 2], puzzle[linePos][charPos - 3]]) == "MAS":
                    count += 1
            # check right
            if charPos <= len(line) - 1 -3:
                if "".join([puzzle[linePos][charPos + 1], puzzle[linePos][charPos + 2], puzzle[linePos][charPos + 3]]) == "MAS":
                    count += 1
            # check NE
            if linePos >= 3 and charPos <= len(line) - 1 -3:
                if "".join([puzzle[linePos - 1][charPos + 1], puzzle[linePos - 2][charPos + 2], puzzle[linePos - 3][charPos + 3]]) == "MAS":                    count += 1
            # check SE
            if linePos <= len(puzzle) - 1 - 3 and charPos <= len(line) - 1 -3:
                if "".join([puzzle[linePos + 1][charPos + 1], puzzle[linePos + 2][charPos + 2], puzzle[linePos + 3][charPos + 3]]) == "MAS":
                    count += 1
            # check SW
            if linePos <= len(puzzle) - 1 - 3 and charPos >= 3:
                if "".join([puzzle[linePos + 1][charPos - 1], puzzle[linePos + 2][charPos - 2], puzzle[linePos + 3][charPos - 3]]) == "MAS":
                    count += 1
            # check NW
            if linePos >= 3 and charPos >= 3:
                if "".join([puzzle[linePos - 1][charPos - 1], puzzle[linePos - 2][charPos - 2], puzzle[linePos - 3][charPos - 3]]) == "MAS":
                    count += 1
print("No. of XMAS:", count)

for linePos, line in enumerate(puzzle):
    for charPos, char in enumerate(line):
        if (char == "A"):
            if charPos >= 1 and charPos <= len(line) - 2 and linePos >= 1 and linePos <= len(puzzle) - 2:
                topLeftChar = puzzle[linePos - 1][charPos - 1]
                topRightChar = puzzle[linePos - 1][charPos + 1]
                bottomLeftChar = puzzle[linePos + 1][charPos - 1]
                bottomRightChar = puzzle[linePos + 1][charPos + 1]

                if (topLeftChar == topRightChar == "M" and bottomLeftChar == bottomRightChar == "S") or (topLeftChar == bottomLeftChar == "M" and topRightChar == bottomRightChar == "S") or (topLeftChar == topRightChar == "S" and bottomLeftChar == bottomRightChar == "M") or (topLeftChar == bottomLeftChar == "S" and topRightChar == bottomRightChar == "M"):
                    xMasCount += 1
            
print("No. of X-MAS:", xMasCount)